import React, { Component } from 'react'
import '../App.css'
import { motion } from "framer-motion"

export class HomePage extends Component {

    render() {
        const container = {
            hidden: { opacity: 0 },
            show: {
              opacity: 1,
              transition: {
                  delay: 1.5,
                  staggerChildren: 2,

              }
            }
          }

          const item = {
            hidden: { opacity: 0 },
            show: { opacity: 1 }
          }
        return (
            <div className="homeInfoCard">
                <motion.ul variants={container} initial="hidden" animate="show" className="home-page-info">
                    <motion.li variants={item} style={{fontSize: "7vh"}}>Andrew Zajac</motion.li>
                    <motion.li variants={item} style={{fontSize: "2.5vh"}}>Software Engineer</motion.li>
                </motion.ul>


            </div>
        )
    }
}

export default HomePage
